            <a href="#" className="navbar-brand">
                NavBar{" "}
                <span className='badge badge-pill badge-secondary'>
                    {this.props.totalCounters}
                </span>
            </a>
            <a className="navbar-brand" href="#">There are {this.props.totalCounters} Counters in total.</a>
